export default (position)=>{
    return fetch(`http://localhost:3001`, {
        method: "POST",
        headers: {
            "Content-Type": "application/json"
        },
        body: JSON.stringify({
            latitude: position.lat,
            longitude: position.lng,
        })
    })
    .then(response=>response.json())
}
